// Content script for IP annotation on supported sites
// This script runs on sites specified in manifest.json and annotates IP addresses using enhanced RIR_IPDB lookups.
// For MLB Park, it uses more precise geolocation when additional octets are available (e.g., "IP: 58.29.*.54").
// For namu.wiki, it uses precise lookup with full IP addresses.
// Now includes Korean Mobile Carrier (ISP) detection for 통피 identification.

// Debug flag - can be toggled via popup
let DEBUG_ENABLED = false;

// Initialize debug state from storage
chrome.storage.local.get(['debugEnabled']).then(result => {
  DEBUG_ENABLED = result.debugEnabled ?? false; // Default to false
});

// Listen for debug toggle messages from popup
chrome.runtime.onMessage.addListener((message, sender, sendResponse) => {
  if (message.type === 'UPDATE_DEBUG') {
    DEBUG_ENABLED = message.debugEnabled;
    debugLog('Debug mode toggled:', DEBUG_ENABLED);
    showTemporaryNotification(`Debug mode ${DEBUG_ENABLED ? 'enabled' : 'disabled'}`);
  } else if (message.type === 'APPLY_IP_ANNOTATION') {
    debugLog('Received APPLY_IP_ANNOTATION message');
    performIPAnnotation();
    sendResponse({ success: true });
  } else if (message.type === 'CLEAR_IP_ANNOTATION') {
    debugLog('Received CLEAR_IP_ANNOTATION message');
    clearIPAnnotations();
    sendResponse({ success: true });
  }
});

function debugLog(message, ...args) {
  if (DEBUG_ENABLED) {
    console.log('[IP-COUNTRY-ANNOTATOR]', message, ...args);
  }
}

debugLog('Content script starting to load...', {
  url: window.location.href,
  readyState: document.readyState,
  timestamp: new Date().toISOString()
});

