  const ALL_RIRS_GZ_BASE64 = ``;

// --- Library implementation ---
(function(global){
    // --- DATA STRUCTURES ---
    let abToCountries = {};
    let ipRanges = [];

    function ipToInt(ip) {
      return ip.split('.').reduce((a, b) => (a << 8) + parseInt(b, 10), 0);
    }

    function parseDelegatedFile(text) {
      abToCountries = {};
      ipRanges = [];
      const lines = text.split('\n');
      for (let line of lines) {
        if (line.startsWith('#')) continue;
        const fields = line.trim().split('|');
        if (fields.length < 7) continue;
        const [ , cc, ipver, start, count ] = fields;
        if (ipver !== "ipv4") continue;
        try {
          const [a, b] = start.split('.').map(Number);
          const ab = `${a}.${b}`;
          const countNum = parseInt(count, 10);
          const startInt = ipToInt(start);
          const endInt = startInt + countNum - 1;
          ipRanges.push({ start: startInt, end: endInt, cc });
          if (!abToCountries[ab]) abToCountries[ab] = new Set();
          abToCountries[ab].add(cc);
        } catch (e) { continue; }
      }
      ipRanges.sort((r1, r2) => r1.start - r2.start);
      Object.keys(abToCountries).forEach(k => {
        abToCountries[k] = Array.from(abToCountries[k]);
      });
    }

    function query_ab(a, b) {
	  // Returns all countries whose allocations overlap with a.b.0.0/16
	  const qStart = (a << 24) | (b << 16);
	  const qEnd = qStart | 0xFFFF;
	  const found = new Set();
	  for (const range of ipRanges) {
		if (range.start <= qEnd && range.end >= qStart) {
		  found.add(range.cc);
		}
	  }
	  return Array.from(found);
    }

    function find_country_for_ip(ipStr) {
      const ipInt = ipToInt(ipStr);
      let left = 0, right = ipRanges.length - 1;
      while (left <= right) {
        let mid = (left + right) >> 1;
        const range = ipRanges[mid];
        if (ipInt < range.start) {
          right = mid - 1;
        } else if (ipInt > range.end) {
          left = mid + 1;
        } else {
          return range.cc;
        }
      }
      return null;
    }

    function getAllAb() {
        return Object.keys(abToCountries);
    }

    // Lazy DB loading promise (so user can wait for it)
    let readyPromise = (async function() {
        debugLog('Starting RIR_IPDB initialization...');
        try {
            debugLog('Decoding base64 data...');
            const gzipped = Uint8Array.from(atob(ALL_RIRS_GZ_BASE64), c => c.charCodeAt(0));
            debugLog('Decompressing gzip data...', gzipped.length, 'bytes');
            const decompressed = fflate.gunzipSync(gzipped);
            debugLog('Decoding text...', decompressed.length, 'bytes');
            const text = new TextDecoder().decode(decompressed);
            debugLog('Parsing delegated file...', text.length, 'characters');
            parseDelegatedFile(text);
            debugLog('RIR_IPDB initialization complete!');
        } catch (error) {
            console.error('[IP-COUNTRY-ANNOTATOR] Error during RIR_IPDB initialization:', error);
            throw error;
        }
    })();

    // Export as global (window.RIR_IPDB)
    global.RIR_IPDB = {
        ready: readyPromise,
        queryAb: query_ab,
        findCountryForIp: find_country_for_ip,
        getAllAb,
    };
    
    debugLog('RIR_IPDB object created on window:', !!global.RIR_IPDB);
    
    // Also ensure it's available immediately after the IIFE completes
    readyPromise.then(() => {
        debugLog('RIR_IPDB ready promise resolved, object available:', !!window.RIR_IPDB);
    }).catch(error => {
        console.error('[IP-COUNTRY-ANNOTATOR] RIR_IPDB ready promise rejected:', error);
    });
})(window);

